/****** Object:  StoredProcedure [dbo].[Get_detallecantidad]    Script Date: 16/10/2019 11:01:48 a. m. ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Jonatan Alexander Rojas>
-- Create date: <16-Junio 2017>
-- Description:	<Verifica el numero de productos>
-- =============================================
CREATE PROCEDURE [dbo].[Get_detallecantidad]
	@factura varchar(4)=''
AS
BEGIN

	SELECT numero
FROM 
(SELECT TOP 1 cantidad1, cantidad2, cantidad3, cantidad4, cantidad5, cantidad6,cantidad7,cantidad8,cantidad9,cantidad10
   FROM detalle_SPA ORDER BY numfac desc) p
UNPIVOT
   (numero FOR factura IN 
      (cantidad1, cantidad2, cantidad3, cantidad4, cantidad5, cantidad6,cantidad7,cantidad8,cantidad9,cantidad10)

)AS unpvt
WHERE numero > ''
			
END





GO
