/****** Object:  StoredProcedure [dbo].[Get_detalleglobal]    Script Date: 16/10/2019 11:01:48 a. m. ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
-- =============================================
-- Author:		<Maria Murillo Lujan>
-- Create date: <05-Junio 2012>
-- Description:	<Registro de log de auditoria>
-- =============================================
CREATE PROCEDURE [dbo].[Get_detalleglobal]
	@factura varchar(4)=''
AS
BEGIN

SELECT TOP 1 *
FROM comprobante_SPA
INNER JOIN factura_SPA
ON comprobante_SPA.numfac = factura_SPA.numfac
INNER JOIN VEHICULO
ON VEHICULO.numfac = comprobante_SPA.numfac
ORDER BY comprobante_SPA.numfac DESC
			
END





