CREATE PROCEDURE [dbo].[Get_detallevalor]
	@factura varchar(4)=''
AS
BEGIN

	SELECT valor
FROM 
(SELECT TOP 1 valor1, valor2, valor3, valor4, valor5, valor6,valor7,valor8,valor9,valor10
   FROM detalle_SPA ORDER BY numfac desc) p
UNPIVOT
   (valor FOR factura IN 
      (valor1, valor2, valor3, valor4, valor5, valor6,valor7,valor8,valor9,valor10)

)AS unpvt
WHERE valor > '0'
			
END





