-- =============================================
-- Author:		<Maria Murillo Lujan>
-- Create date: <05-Junio 2012>
-- Description:	<Registro de log de auditoria>
-- =============================================
CREATE PROCEDURE [dbo].[Get_facturas_filter]
	@Filtro VARCHAR(300) = ''
AS
BEGIN

	IF @Filtro = '-1'
		BEGIN
			SELECT F.numfac Factura, F.tipo_doc Tipo_Documento, F.numero_doc Numero_Documento, F.nom_client Cliente, V.Placa_Vehiculo Placa,
				V.Marca_Vehiculo Marca, C.total Total, C.fecha FechaCreacion FROM factura_SPA F
			INNER JOIN comprobante_SPA C
				ON F.numfac = C.numfac
			INNER JOIN VEHICULO V
				ON F.numfac = V.numfac
			INNER JOIN (SELECT NumFac FROM [dbo].[detalleFactura]
						GROUP BY NumFac) DT
				ON F.numfac = DT.NumFac
		ORDER BY F.numfac DESC
		END
	ELSE
		BEGIN
		SELECT F.numfac Factura, F.tipo_doc Tipo_Documento, F.numero_doc Numero_Documento, F.nom_client Cliente, V.Placa_Vehiculo Placa,
				V.Marca_Vehiculo Marca, C.total Total, C.fecha FechaCreacion FROM factura_SPA F
			INNER JOIN comprobante_SPA C
				ON F.numfac = C.numfac
			INNER JOIN VEHICULO V
				ON F.numfac = V.numfac
			INNER JOIN (SELECT NumFac FROM [dbo].[detalleFactura]
						GROUP BY NumFac) DT
				ON F.numfac = DT.NumFac
		WHERE CONVERT(VARCHAR(10), F.numfac) = @Filtro OR F.numero_doc LIKE '%' + @Filtro + '%' OR F.nom_client LIKE '%' + @Filtro + '%' 
--OR CONVERT(DATE, C.fecha) = @Filtro
		ORDER BY F.numfac DESC
		END		
END





