-- Description:	<Inserta personas>
-- =============================================
CREATE PROCEDURE [dbo].[InsertarPersona]
	@cedula varchar(15)='',
	@tipo varchar(10)='',
	@apellidos varchar(35)='',
	@nombres varchar(35)='',
	@telefono1 varchar(20),
	@telefono2 varchar(20),
	@direccion varchar(max),
	@barrio varchar(4),
	@departamento varchar(4),
	@placa varchar(7),
	@referencia varchar(MAX),
	@fecha datetime,
	@estado varchar(4),
	@especialidad varchar(MAX)
AS
BEGIN

	INSERT INTO PERSONA(CC_Cliente, Tipo_Persona, Apellido_Cliente, Nombre_Cliente, Telefono_Cliente1,
						Telefono_Cliente2, Direccion_Cliente, Cod_Barrio, Cod_Depto, Placa_Vehiculo,
						Referencia_Personal, Fecha_Ingreso, Estado, Especialidad_Mecanico)
	
	VALUES(@cedula, @tipo, @apellidos, @nombres, @telefono1, @telefono2, @direccion, @barrio,
			@departamento, @placa, @referencia, @fecha, @estado, @especialidad)

	INSERT INTO MANTENIMIENTO(Cod_proceso, Fecha_Mantenimiento, CC_Cliente, Placa_Vehiculo,
								Cod_Repuesto, Valor_mantenimiento, Aplica_Garantia, Mecanico)

	VALUES ((@cedula + @placa), @fecha, @cedula, @placa, '', '0', 'false', '')
			
END





