CREATE PROCEDURE [dbo].[Set_Factura]
	@fecha datetime='',
	@fechaentrega datetime = '',
	@nit varchar(10)='',
	@numfac int,
	@detalle varchar(MAX)='',
	@caja varchar(50) = '',
	@tipodoc varchar(6) = '',
	@docclie varchar(12) = '',
	@nomcli varchar(50) = '',
	--@numprod1 varchar(4) = '',
	--@det1 varchar(MAX) = '',
	--@val1 varchar(20) = '',
	--@numprod2 varchar(4) = '',
	--@det2 varchar(MAX) = '',
	--@val2 varchar(20) = '',
	--@numprod3 varchar(4) = '',
	--@det3 varchar(MAX) = '',
	--@val3 varchar(20) = '',
	--@numprod4 varchar(4) = '',
	--@det4 varchar(MAX) = '',
	--@val4 varchar(20) = '',
	--@numprod5 varchar(4),
	--@det5 varchar(MAX),
	--@val5 varchar(20),
	--@numprod6 varchar(4),
	--@det6 varchar(MAX),
	--@val6 varchar(20),
	--@numprod7 varchar(4),
	--@det7 varchar(MAX),
	--@val7 varchar(20),
	--@numprod8 varchar(4),
	--@det8 varchar(MAX),
	--@val8 varchar(20),
	--@numprod9 varchar(4),
	--@det9 varchar(MAX),
	--@val9 varchar(20),
	--@numprod10 varchar(4),
	--@det10 varchar(MAX),
	--@val10 varchar(20),
	@total INT,
	@valrecibido INT,
	@cambio INT,
	@iva INT = 0,
	@subtotal INT = 0,
	@mecanica varchar(MAX) = '',
	@latoneria varchar(MAX) = '',
	@pintura varchar(MAX) = '',
	@placa varchar(10) = '',
	@marca varchar(20) = '',
	@modelo varchar(20) = '',
	@tipo varchar(80) = ''
AS
BEGIN

	INSERT INTO factura_SPA(numfac, nit, fecha, detalle, cajero, numero_doc, tipo_doc, nom_client, mecanica, latoneria, pintura, fechaentrega, tipo)
	VALUES  (@numfac, @nit, @fecha, @detalle, @caja, @docclie, @tipodoc, @nomcli, @mecanica, @latoneria, @pintura, @fechaentrega, @tipo)
	
	IF NOT EXISTS (SELECT * FROM client_SPA WHERE numero_doc = @docclie AND tipo_doc = @tipodoc AND nombre_cli = @nomcli)
	BEGIN
		INSERT INTO client_SPA (tipo_doc, numero_doc, nombre_cli, fecha_compra)
		VALUES (@tipodoc, @docclie, @nomcli, @fecha)
	END
	
	
	INSERT INTO VEHICULO (Placa_Vehiculo, Marca_Vehiculo, Modelo, numfac, tipo)
	VALUES (@placa, @marca, @modelo, @numfac, @tipo)

	
	--INSERT INTO detalle_SPA (cantidad1, detalle_fac1, valor1, numfac, fecha, cantidad2, detalle_fac2, valor2, cantidad3, detalle_fac3, valor3, cantidad4, detalle_fac4, valor4, cantidad5, detalle_fac5, valor5, 
	--cantidad6, detalle_fac6, valor6, cantidad7, detalle_fac7, valor7, cantidad8, detalle_fac8, valor8, cantidad9, detalle_fac9, valor9, cantidad10, detalle_fac10, valor10)
	--VALUES (@numprod1, @det1, @val1, @numfac, @fecha, @numprod2, @det2, @val2, @numprod3, @det3, @val3, @numprod4, @det4, @val4,
	--		@numprod5, @det5, @val5, @numprod6, @det6, @val6, @numprod7, @det7, @val7, @numprod8, @det8, @val8, @numprod9, @det9, @val9, @numprod10, @det10, @val10)

	INSERT INTO comprobante_SPA (fecha, numfac, total, valorrecibido, cambio, iva, subtotal, detalle)
	VALUES (GETDATE(), @numfac, @total, @valrecibido, @cambio, @iva, @subtotal, @detalle)

	
END




