CREATE PROCEDURE [dbo].[Set_Factura_Detalle]
	@NumFac INT,
	@Producto VARCHAR(300) = '',
	@Cantidad INT= 1,
	@Valor int
	AS
BEGIN

	INSERT INTO detalleFactura(numfac, Producto, Cantidad, Valor, Fecha_Creacion)
	VALUES  (@numfac, @Producto, @Cantidad, @Valor, GETDATE())
	
	
END




