CREATE PROCEDURE [dbo].[updatedetail]
	@id int,
	@detalle varchar(MAX)='',
	@valor varchar(30)
AS
BEGIN

UPDATE producto_SPA SET producto = @detalle, valor = @valor
		WHERE id = @id			
END





